@bhati 

teri maa ko mein apne bed par lamha dalkar sari raat meine uski deelhi fudi mein apna lun ghuseda to uski chekhe pure mohale mein gunji.saale apna DNA test apne baap se kara,teri maa ko to tera neighbour chodke gya tha.ratko teri maa nangi bistar par apni naram-2 gand bichayi leti thi aur phir tumara guwandi dewar langhkar tumahre ghar akar teri maa ko chod gya tab jakar tera janam hua.teri maa ke ghode ka lun gadhe ka lun.bhenchode.kal meine teri bhehen ko bar mein nangi dance karte dekha tha
8 ladhko ko beech teri maa aur behen ek saath,koi fudi mein koi gand mein dal raha tha.teri maa behan unke chupe laga rahi thi
